import React from 'react';

function QuantumBasics() {
  return (
    <div>
      <h1>Module 1: Quantum Computing Basics</h1>
      <p>Learn about the fundamental concepts of Quantum Computing:</p>
      <ul>
        <li><strong>Qubits:</strong> The fundamental units of quantum computing.</li>
        <li><strong>Superposition:</strong> A quantum particle's ability to exist in multiple states.</li>
        <li><strong>Entanglement:</strong> A phenomenon where two qubits are linked, regardless of distance.</li>
      </ul>
    </div>
  );
}

export default QuantumBasics;
